import { Button, Carousel } from 'antd'
import React from 'react'
import Screen from '../../components/Screen/Screen';
import './Organigrama.scss';




export default function Organigrama() {

    const data = {
        title: "titulo",
        Subtitle: "Subtitulo",
        text: "texto"
    }

    const contentStyle = {
        height: '160px',
        color: '#fff',
        lineHeight: '160px',
        textAlign: 'center',
        background: '#364d79',
      };

    return (
        <div className="square custom" >            
            <p><Button type="primary" onClick={message} >
                With extra props
            </Button></p>
           
        </div>
    )
}


const message = () => {
    alert("kjhkhkh");
    
}

function onChange(a, b, c) {
    console.log(a, b, c);
